import React from 'react';

import classes from './CarInfo.module.css';
import CarServices from './CarServices';

const CarInfo = (props) => {
  const getCar = props.allCars.filter((car) => car.id === props.loadCarId);

  const infoCar = getCar.map((car) => {
    return (
      <div key={car.id}>
        <ul>
          <li>
            brand:<p>{car.brand}</p>
          </li>
          <li>
            series:<p>{car.series}</p>
          </li>
          <li>
            model:<p>{car.model}</p>
          </li>
          <li>
            year:<p>{car.year}</p>
          </li>
          <li>
            engine:<p>{car.engine}</p>
          </li>
          <li>
            mileage:<p>{car.mileage}</p>
          </li>
        </ul>
        <CarServices allCarServices={car.services} />
      </div>
    );
  });

  return (
    <div className={classes['car-info']}>
      <div className={classes['car-info-main']}>{infoCar}</div>
    </div>
  );
};

export default CarInfo;
